    false,nt"url": null,nt"notes": "<p>Medicare Part D Roulette, Potential
    Implications of Random Assignment and Plan Restrictions<br />nDual-eligible (Medicare
    and Medicaid) beneficiaries are randomly assigned to a benchmark plan, which provides
    prescription drug coverage under the Part D benefit without consideration of their
    prescription drug profile. To date, the potential for beneficiary assignment to
    a plan with poor formulary coverage has been minimally studied and the resultant
    financial impact to beneficiaries unknown.</p>n",nt"license_title": "License
